[Form]
public class BudgetAnalysisDimensionFocusSummary extends FormRun
{
    BudgetAnalysisSummaryForm                   budgetAnalysisSummaryForm;
    DimensionHierarchy                          dimHier;

    private boolean isLedgerBalanceFeatureEnabled = FeatureStateProvider::IsFeatureEnabled(GeneralLedgerBalanceFeature::instance());

    private const str GeneralLedgerBalanceFeatureWhatsNewGuidStr = '{92bef746-dc5a-4fbf-93da-8e7485de16ac}';

    #Dimensions
}

public void init()
{
    super();

    if (GeneralLedgerBalanceFeatureRecommendationFlight::instance().isEnabled()
        && !isLedgerBalanceFeatureEnabled)
    {
        SystemNotificationsWhatsNewManager::AddWhatsNewWithActionLink(
            GeneralLedgerBalanceFeatureWhatsNewGuidStr,
            "@GeneralLedger:GeneralLedgerBalanceFeature",
            "@GeneralLedger:GeneralLedgerBalanceFeatureSummary",
            ctrlDimensionSet.name(),
            "@GeneralLedger:GeneralLedgerBalanceFeatureLink");
    }

    budgetAnalysisSummaryForm = BudgetAnalysisSummaryForm::construct(element);

    if (!dimHier)
    {
        dimHier = DimensionHierarchy::getMainAccountFocus();
    }

    this.setDataSourceForDisplayValue();
}

private void setupQuery()
{
    Query query = this.query();

    if (isLedgerBalanceFeatureEnabled)
    {
        this.setDataSourceEnabled(query, tableNum(DimensionFocusNameTmp), false);
        this.setDataSourceEnabled(query, tableNum(DimensionAttributeValueCombination), false);

        RefTableId t1 = tableNum(GeneralLedgerBalanceReportingDimension);
        RefTableId t2 = GeneralLedgerBalanceReportingDimension_ds.id();

        QueryBuildDataSource balanceReportingDimensionQS = query.dataSourceTable(tableNum(GeneralLedgerBalanceReportingDimension));

        if (!balanceReportingDimensionQS)
        {
            balanceReportingDimensionQS = query.dataSourceName(this.name()).addDataSource(tableNum(GeneralLedgerBalanceReportingDimension));
            balanceReportingDimensionQS.joinMode(JoinMode::InnerJoin);
            balanceReportingDimensionQS.addLink(
                fieldNum(BudgetAnalysisDimensionSummaryTmp, ReportingDimension),
                fieldNum(GeneralLedgerBalanceReportingDimension, RecId));
            balanceReportingDimensionQS.enabled(true);
        }
    }
    else
    {
        this.setDataSourceEnabled(query, tableNum(GeneralLedgerBalanceReportingDimension), false);
    }
}

private void setDataSourceEnabled(Query _query, TableId _tableId, boolean _enabled)
{
    QueryBuildDataSource qbds = _query.dataSourceTable(_tableId);

    if (qbds && qbds.enabled() != _enabled)
    {
        qbds.enabled(_enabled);
    }
}

public void init()
{
    super();

    if (!isLedgerBalanceFeatureEnabled)
    {
        QueryBuildRange rangeLedgerAccount = this.query().dataSourceName(this.name()).addRange(fieldNum(DimensionAttributeValueCombination, DisplayValue));
        this.query().dataSourceTable(tableNum(DimensionAttributeValueCombination)).addSortField(fieldNum(DimensionAttributeValueCombination, DisplayValue));
    }
}

public boolean validate()
{
    boolean isValid;

    isValid = super();

    dimHier = DimensionHierarchy::findByTypeAndName(DimensionHierarchyType::Focus, ctrlDimensionSet.text());
    if (dimHier == null)
    {
        isValid = checkFailed(strFmt("@SYS333565", ctrlDimensionSet.text()));
    }

    return isValid;
}

public boolean modified()
{
    boolean isModified, isValid;
    budgetAnalysisInquiryHelper_PSN budgetAnalysisInquiryHelper = new budgetAnalysisInquiryHelper_PSN();

    isModified = super();

    if (isModified)
    {
        isValid = budgetAnalysisInquiryHelper.setDatesByInterval(this.valueStr());
        if (isValid)
        {
            ctrlFromDate.dateValue(budgetAnalysisInquiryHelper.parmStartDate());
            ctrlToDate.dateValue(budgetAnalysisInquiryHelper.parmEndDate());

        }
        else
        {
            this.text('');
        }
    }

    return isModified;
}

public boolean modified()
{
    boolean isModified;

    isModified = super();

    if (isModified)
    {
        ctrlDateInterval.text('');
    }

    return isModified;
}

public boolean modified()
{
    boolean isModified;

    isModified = super();

    if (isModified)
    {
        ctrlDateInterval.text('');
    }

    return isModified;
}

void clicked()
{
    boolean isValid = true;

    if (!ctrlFromDate.dateValue())
    {
        isValid = checkFailed("@SYS97591");
    }

    if (!ctrlToDate.dateValue())
    {
        isValid = checkFailed("@SYS97592");
    }

    if (dimHier == null)
    {
        isValid = checkFailed(strFmt("@SYS333565", ctrlDimensionSet.text()));
    }

    if (isValid)
    {
        budgetAnalysisSummaryForm.apply(budgetAnalysisDimensionSummaryTmp, budgetAnalysisDimensionGrandTotalTemp, dimensionFocusNameTmp);

        budgetAnalysisDimensionSummaryTmp_ds.executeQuery();
        budgetAnalysisDimensionGrandTotalTemp_ds.executeQuery();
    }

}
